import React, { useState } from "react";
import { css } from "@emotion/core";
import Link from "next/link";
import { useRouter } from "next/router";
import { COLORS } from "../../constants";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faColumns,
  faFileImport,
  faNotesMedical,
  faBook,
  faBell,
  faUser,
  faList,
  faIdBadge,
  faCalendar,
  faKeyboard,
  faChartBar,
  faPhone,
  faTint,
  faChevronCircleRight,
  faArrowRight,
  faChevronRight,
  faPeopleArrows,
} from "@fortawesome/free-solid-svg-icons";

const SideNavLinks = () => {
  const router = useRouter();
  const [dropMenu, setDropMenu] = useState(false);

  const toggleAlloCourceMenu = () => {
    setDropMenu(!dropMenu);
  };

  return (
    <React.Fragment>
      <ul
        css={css`
          height: calc(100% - 190px);
          overflow-y: auto;
          overflow-x: hidden;
          padding: 10px 40px 10px 40px;
          color: ${COLORS.TEXTGRAY};
          & > li > a {
            padding: 8px 0px;
            display: block;

            border-bottom: 1px solid ${COLORS.DARKBORDER};
            font-size: 13px;
            &:hover {
              color: ${COLORS.WHITE};
            }
          }
        `}
      >
        <li
          css={
            router.pathname === "/dashboard"
              ? css`
                  color: ${COLORS.WHITE};
                `
              : css`
                  color: ${COLORS.TEXTGRAY};
                `
          }
        >
          <Link href="/dashboard">
            <a>
              <FontAwesomeIcon icon={faColumns} /> Dashboard
            </a>
          </Link>
        </li>

        <li
          css={
            router.pathname === "/imports"
              ? css`
                  color: ${COLORS.WHITE};
                `
              : css`
                  color: ${COLORS.TEXTGRAY};
                `
          }
        >
          <Link href="/imports">
            <a>
              <FontAwesomeIcon icon={faFileImport} /> Imports
            </a>
          </Link>
        </li>

        <li
          css={
            router.pathname === "/notifications"
              ? css`
                  color: ${COLORS.WHITE};
                `
              : css`
                  color: ${COLORS.TEXTGRAY};
                `
          }
        >
          <Link href="/notifications">
            <a>
              <FontAwesomeIcon icon={faBell} /> Notifications
            </a>
          </Link>
        </li>

        <li
          css={
            router.pathname === "/profile"
              ? css`
                  color: ${COLORS.WHITE};
                `
              : css`
                  color: ${COLORS.TEXTGRAY};
                `
          }
        >
          <Link href="/profile">
            <a>
              <FontAwesomeIcon icon={faUser} /> Profile
            </a>
          </Link>
        </li>

        <li
          css={
            router.pathname === "/allocated-coureces"
              ? css`
                  color: ${COLORS.WHITE};
                `
              : css`
                  color: ${COLORS.TEXTGRAY};
                `
          }
        >
          <a className="clearfix cursor-pointer" onClick={toggleAlloCourceMenu}>
            <FontAwesomeIcon icon={faList} /> Allocated Courses
            <span className="float-right">
              <FontAwesomeIcon
                icon={faChevronRight}
                css={
                  dropMenu
                    ? css`
                        transform: rotate(90deg);
                        transition: all 0.1s ease-in-out;
                      `
                    : css`
                        transform: rotate(0deg);
                        transition: all 0.1s ease-in-out;
                      `
                }
              />
            </span>
          </a>
          {dropMenu && (
            <ul
              className="ml-6 font-sans text-sm"
              css={css`
                & > li {
                  padding: 4px 0px;
                }
              `}
            >
              <li>
                <FontAwesomeIcon icon={faBook} /> Allocated Cources
              </li>
              <li>
                <FontAwesomeIcon icon={faPeopleArrows} /> Attendance
              </li>
              <li>Mark Entry</li>
              <li>Assignment Creation</li>
            </ul>
          )}
        </li>

        <li
          css={
            router.pathname === "/cource-coordinator-allocation"
              ? css`
                  color: ${COLORS.WHITE};
                `
              : css`
                  color: ${COLORS.TEXTGRAY};
                `
          }
        >
          <Link href="/cource-coordinator-allocation">
            <a>
              <FontAwesomeIcon icon={faIdBadge} /> Cource Coordinator Allocation
            </a>
          </Link>
        </li>

        <li
          css={
            router.pathname === "/class-schedule"
              ? css`
                  color: ${COLORS.WHITE};
                `
              : css`
                  color: ${COLORS.TEXTGRAY};
                `
          }
        >
          <Link href="/class-schedule">
            <a>
              <FontAwesomeIcon icon={faCalendar} /> Class Schedule
